import { useState } from 'react';
import { Box, Container, Typography, Stack } from '@mui/material';
import QrCode2Icon from '@mui/icons-material/QrCode2';
import { useTranslation } from 'react-i18next';

const width = window.innerWidth;
const height = (width <= 479 ? window.innerHeight - 175 : window.innerHeight - 215) + "px";

const LoginPage = () => {

    ////// Translate
    const { t } = useTranslation();

    return (
        <>
            <Box className="s-home-2">
                <Box className="s-home-content">
                    <Container>
                        <Box className="s-form-content">
                            <Box sx={{ width: "100%", minHeight: height, }}>
                                <Box className="b-card-3">
                                    <Stack direction="row" alignItems="center" justifyContent="center" gap={2}>
                                        <Box sx={{ textAlign: "center", position: "relative", transform: "rotate(45deg)" }}>
                                            <QrCode2Icon style={{ fontSize: 35 }} />
                                            <Box className="b-qr-border"></Box>
                                        </Box>
                                        <Typography className="b-title">Change Password</Typography>
                                    </Stack>
                                    <Typography className="b-desc">{t('notify_desc')}</Typography>
                                </Box>
                            </Box>
                        </Box>
                    </Container>
                </Box>
            </Box>
        </>
    )
}

export default LoginPage;
